  false,\n\t\"url\": null,\n\t\"notes\": \"Supplements to the Monthly Weather Review
  publication. The Weather Bureau published the Monthly weather review Supplement
  irregularly from 1914 to 1949. The Supplement replaced numerous independent series
  of bulletins that the Bureau published before 1914. The Supplements featured contributions
  to the science of meteorology and weather forecasting that were too voluminous to
  publish in the regular Monthly weather review. The Bureau never published no. 43.
  The Monthly Weather Review series has also been scanned, and is hosted by the American
  Meteorological Society, which assumed publication in 1974.\",\n\t\"license_title\":
